CREATE TABLE boat (
    `pclass` INT,
    `survived` INT,
    `name` VARCHAR(82) CHARACTER SET utf8,
    `sex` VARCHAR(6) CHARACTER SET utf8,
    `age` NUMERIC(7, 4),
    `ticket` VARCHAR(18) CHARACTER SET utf8,
    `fare` NUMERIC(7, 4),
    `cabin` VARCHAR(15) CHARACTER SET utf8,
    `home_dest` VARCHAR(50) CHARACTER SET utf8
);
